SHOW DATABASES;

-- Create databases
CREATE DATABASE weatherActivityApi;
USE weatherActivityApi;

-- Drop DATABASE weatherActivityApi;


-- Create tables
CREATE TABLE place (
    id        INT PRIMARY KEY AUTO_INCREMENT,
    name      VARCHAR(25) NOT NULL,
    longitude VARCHAR(20) NOT NULL,
    latitude  VARCHAR(20) NOT NULL
);

CREATE TABLE activity (
    id   INT PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(50) NOT NULL
);

CREATE TABLE activityPlace (
    id  INT PRIMARY KEY AUTO_INCREMENT,
    pId INT NOT NULL,
    aId INT NOT NULL,

    FOREIGN KEY (pId) REFERENCES place (id),
    FOREIGN KEY (aId) REFERENCES activity (id)
);

CREATE TABLE weatherOptimal (
    id          INT PRIMARY KEY AUTO_INCREMENT,
    activity    INT NOT NULL,

    cloudy      NUMERIC NOT NULL,
    rainfall    NUMERIC NOT NULL,
    temperature NUMERIC NOT NULL,
    wind        NUMERIC NOT NULL
);

CREATE TABLE activityWeather (
    id  INT PRIMARY KEY AUTO_INCREMENT,
    aId INT NOT NULL,
    vId INT NOT NULL,

    FOREIGN KEY (aId) REFERENCES activity (id),
    FOREIGN KEY (vId) REFERENCES weatherOptimal (id)
);

CREATE TABLE cachePlaceParameters (
    id          INT PRIMARY KEY AUTO_INCREMENT,
    place       INT NOT NULL,
    day         INT NOT NULL,

    temperature INT NOT NULL,
    wind        INT NOT NULL,
    cloud       INT NOT NULL,

    FOREIGN KEY (place) REFERENCES place (id)
);

CREATE TABLE cacheScores (
    id             INT PRIMARY KEY AUTO_INCREMENT,
    place          INT NOT NULL,
    day            INT NOT NULL,

    fishing        NUMERIC NOT NULL,
    outdoorSeating NUMERIC NOT NULL,
    sunBathing     NUMERIC NOT NULL,
    volleyBall     NUMERIC NOT NULL,
    windSurfing    NUMERIC NOT NULL,

    FOREIGN KEY (place) REFERENCES place (id)
);

-- DROP TABLE cacheScores;


